def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5)+1):
        if n % i == 0:
            return False
    return True

def is_prime_row(row):
    for x in row:
        if not is_prime(x):
            return False
    return True

def is_prime_col(col):
    for x in col:
        if not is_prime(x):
            return False
    return True

