def ncr(n, r):
    if n < r:
        return 0
    if n == r:
        return 1
    r = min(r, n - r)
    numer = 1
    denom = 1
    for i in range(r):
        numer = (numer * (n - i)) % MOD
        denom = (denom * (i + 1)) % MOD
    return (numer * inv(denom)) % MOD

