def comb(n, r):
    if n < r:
        return 0
    r = min(r, n-r)
    a = 1
    b = 1
    for i in range(r):
        a = (a * (n-i)) % MOD
        b = (b * (i+1)) % MOD
    return (a * inv(b)) % MOD

