def power(a, b):
    if b == 0:
        return 1
    if b % 2 == 0:
        return power((a * a) % MOD, b // 2)
    else:
        return (a * power((a * a) % MOD, (b - 1) // 2)) % MOD

def inv(a):
    return power(a, MOD - 2)

def comb(n, k):
    return (comb(n, k - 1) * inv(k)) % MOD

