def ncr(n, r):
    if n < r:
        return 0
    if r == 0:
        return 1
    if r == 1:
        return n
    if r == n:
        return 1
    if r > n - r:
        r = n - r
    val = 1
    for i in range(r):
        val = val * (n - i)
        val = val // (i + 1)
    return val

