def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

class SegTree:
    def __init__(self, n):
        self.n = n
        self.tree = [0] * (4 * n)

    def update(self, idx, val):
        self._update(1, 1, self.n, idx, val)

    def _update(self, node, start, end, idx, val):
        if start == end:
            self.tree[node] = val
            return
        mid = (start + end) // 2
        if idx <= mid:
            self._update(2 * node, start, mid, idx, val)
        else:
            self._update(2 * node + 1, mid + 1, end, idx, val)
        self.tree[node] = gcd(self.tree[2 * node], self.tree[2 * node + 1])

    def query(self, l, r):
        return self._query(1, 1, self.n, l, r)

    def _query(self, node, start, end, l, r):
        if r < start or end < l:
            return 0
        if l <= start and end <= r:
            return self.tree[node]
        mid = (start + end) // 2
        return gcd(self._query(2 * node, start, mid, l, r), self._query(2 * node + 1, mid + 1, end, l, r))

    def __str__(self):
        return ' '.join(map(str, self.tree))

