def solve(r, c, maze):
    odd = []
    even = []
    for i in range(r):
        for j in range(c):
            if (i + j) % 2 == 0:
                if maze[i][j] == '.':
                    even.append((i, j))
                else:
                    odd.append((i, j))
            else:
                if maze[i][j] == '.':
                    odd.append((i, j))
                else:
                    even.append((i, j))
    if len(odd) == 0 or len(even) == 0:
        return r * c - len(odd) - len(even)
    return r * c - len(odd) - len(even) - 1

