MOD = 998244353

def power(a, b):
    if b == 0:
        return 1
    if b % 2 == 0:
        return power(a * a, b // 2) % MOD
    else:
        return a * power(a * a, (b - 1) // 2) % MOD

def inv(a):
    return power(a, MOD - 2)

def comb(n, r):
    if r > n:
        return 0
    r = min(r, n - r)
    return power(n, r) * inv(power(r, r)) % MOD * inv(power(n - r, n - r)) % MOD

