        ans += solve(n, colors[1:], forbidden, sequence[1:])
    else:
        ans += solve(n, colors[1:], forbidden, sequence)

    ans %= MOD
    ans += solve(n, colors[1:], forbidden, sequence) * combination(len(sequence), 1)
    ans %= MOD

