def popcount(n):
    count = 0
    while n:
        count += n & 1
        n >>= 1
    return count

def solve(n, k):
    if k == 0:
        return popcount(n)
    if k == 1:
        return 1
    if n == 0:
        return 0
    if n < 0:
        return solve(-n, k)
    if k > popcount(n):
        return 0
    if k == popcount(n):
        return 1
    return (solve(n - 1, k - 1) + solve(n, k)) % MOD

