def dist(x1, y1, x2, y2):
    return math.sqrt((x2 - x1) ** 2 + (y2 - y1) ** 2)

def speed(vx, vy):
    return math.sqrt(vx ** 2 + vy ** 2)

def time(vx, vy, x1, y1, x2, y2):
    return dist(x1, y1, x2, y2) / speed(vx, vy)

def wind(vx1, vy1, wx1, wy1, vx2, vy2, wx2, wy2, t):
    return (vx1 * t + wx1 * (t - 1) / 2, vy1 * t + wy1 * (t - 1) / 2), (vx2 * t + wx2 * t, vy2 * t + wy2 * t)

def solve(vx1, vy1, wx1, wy1, vx2, vy2, wx2, wy2, t):
    if t == 0:
        return time(vx1, vy1, x1, y1, x2, y2)
    else:
        w1, w2 = wind(vx1, vy1, wx1, wy1, vx2, vy2, wx2, wy2, t)
        return min(time(vx1, vy1, x1, y1, x2, y2), time(w1[0], w1[1], x1, y1, w2[0], w2[1], x2, y2), time(w2[0], w2[1], x1, y1, x2, y2))

