import itertools
import math

def area(a, b):
    return a * b

def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def lcm(a, b):
    return a * b // gcd(a, b)

def lcm_list(numbers):
    return reduce(lcm, numbers)

def solve(cards, envelopes):
    cards = sorted(cards, key=lambda x: x[2], reverse=True)
    envelopes = sorted(envelopes, key=lambda x: x[0] * x[1], reverse=True)
    cards = list(itertools.combinations(cards, len(envelopes)))
    cards = [sorted([area(c[0], c[1]), c[2]]) for c in cards]
    cards = [sum([a[0] for a in c]) for c in cards]
    return min(cards)

