        dp[i][i] = int(s[i])
    for l in range(2, n+1):
        for i in range(n-l+1):
            j = i+l-1
            dp[i][j] = dp[i][j-1] + dp[i+1][j]
            if s[j-1] == '+':
                for k in range(i, j):
